// 1 second per fold
function simplifyBruteForce(polymer) {
  let simplifiedPolymer;
  while (true) {
    simplifiedPolymer = "";
    for (let i = 0; i < polymer.length; i++) {
      const a = polymer[i];
      const b = polymer[i + 1];
      if (b === undefined) {
        // Handle the last letter
        simplifiedPolymer += a;
      } else if (a === b) {
        // Skip AA and aa
        simplifiedPolymer += a;
      } else if (a.toLowerCase() !== b.toLowerCase()) {
        // Skip anything which is not aA or Aa
        simplifiedPolymer += a;
      } else {
        // Increment by 1 to skip the next letter as well
        i++;
      }
    }
    if (polymer === simplifiedPolymer) break;
    polymer = simplifiedPolymer;
  }
  return simplifiedPolymer;
}

class DLLNode {
  constructor(value) {
    this.value = value;
    this.next = null;
    this.previous = null;
  }

  append(value) {
    const node = new DLLNode(value);
    if (this.next) throw new Error("Invariant not uppheld");
    node.previous = this;
    this.next = node;
    return node;
  }

  size() {
    let size = 0;
    let head = this;
    while(head) {
      size++;
      head = head.next;
    }
    return size;
  }

  toString() {
    let str = "";
    let head = this;
    while(head) {
      str += head.value;
      head = head.next;
    }
    return str;
  }
}

// 15 milli seconds per fold
function simplify(polymer) {
  let head, root;
  for (const letter of polymer) {
    if (head) {
      head = head.append(letter);
    } else {
      head = new DLLNode(letter);
      root = head;
    }
  }

  head = root;
  while (head) {
    const next = head.next;
    if(!next) break;

    const a = head.value;
    const b = next.value;
    if (a === b) {
      // Skip AA and aa
      head = next;
    } else if (a.toLowerCase() !== b.toLowerCase()) {
      // Skip anything which is not aA or Aa
      head = next;
    } else {
      if(head.previous) {
        const previous = head.previous;
        previous.next = next.next;
        if(previous.next) {
          previous.next.previous = previous;
        }
        head = previous;
      } else {
        root = next.next;
        root.previous = null;
        root.next.previous = root;
        head = root;
      }
    }
  }

  return root.toString();
}

export function day5a() {
  const polymer = simplify(input);
  return polymer.length;
}

